import React from 'react';
import '../App.css';
import {Link} from 'react-router-dom';
function Nav() {
    const navStyle = {
        color: 'white'
    }
  return (
  <nav>
      <h2>Single Signon</h2>

      <Link style={navStyle} to="/email">
          <div className="col">
      <li className="navi">Contact</li></div>
      </Link>
      <Link style={navStyle} to="/">
      <div className="col1">
      <li className="navi">Guide</li></div>
      </Link>   
      <Link style={navStyle} to="/toogle">
      <div className="col2">
      <li className="navi">Config</li></div>
      </Link>

      </nav>
  );
}

export default Nav;
